import React, { useState } from "react"

import {
  BarChart,
  Bar,
  Cell,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  Legend
} from "recharts";

import subways_with_tracts from './data/subways_with_tracts.json'

function RenderBarChart() {


    return (
        <div>
            <BarChart
                width={500}
                height={300}
                data={subways_with_tracts}
                margin={{
                top: 5, right: 30, left: 20, bottom: 5,
                }}
            >
                <CartesianGrid strokeDasharray="3 3" />

                <YAxis />
                <Tooltip datakey = "Stop_Name"/>
                <Legend />
                <Bar dataKey="DP05_0071PE" fill="#8884d8" />
            </BarChart>
        </div>

    );
}

export default RenderBarChart;
